pragma solidity ^0.8.2;

import '@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol';
import '@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol';
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract MintNFT is ERC721Enumerable{
    using SafeMath for uint256;
    mapping (uint256 => string) private _tokenURIs;
    mapping (uint256 => address) public _ownerTokenURIs;
    string[] tokenToOwner;
    constructor() ERC721("First Collection","FRS") ERC721Enumerable(){}

    function mint(address _to, string memory _tokenURI) public returns(bool) {
       uint _tokenId = totalSupply().add(1);
       _mint(_to, _tokenId);
       _setTokenURI(_tokenId, _tokenURI);
       return true;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721URIStorage: URI query for nonexistent token");

        string memory _tokenURI = _tokenURIs[tokenId];
        string memory base = _baseURI();

        // If there is no base URI, return the token URI.
        if (bytes(base).length == 0) {
            return _tokenURI;
        }
        // If both are set, concatenate the baseURI and tokenURI (via abi.encodePacked).
        if (bytes(_tokenURI).length > 0) {
            return string(abi.encodePacked(base, _tokenURI));
        }

        return super.tokenURI(tokenId);
    }

    function returnTokenURIsOfOwner() public returns(string[] memory){
        for(uint8 i = 0; i < totalSupply(); i++){
            if(_ownerTokenURIs[i] == msg.sender){
                tokenToOwner.push(_tokenURIs[i]); 
            }
        }
        return tokenToOwner;
    }

    function _setTokenURI(uint256 tokenId, string memory _tokenURI) internal virtual {
        require(_exists(tokenId), "ERC721URIStorage: URI set of nonexistent token");
        _tokenURIs[tokenId] = _tokenURI;
        _ownerTokenURIs[tokenId] = msg.sender;
    }

    function returnTotalSupply() public view returns(uint){
        return totalSupply();
    }

    function _burn(uint256 tokenId) internal virtual override {
        super._burn(tokenId);

        if (bytes(_tokenURIs[tokenId]).length != 0) {
            delete _tokenURIs[tokenId];
        }
    }
}
